import React from "react";
import { siteData } from "./info/data";
import memberCard from './memberCard';
import pres from './info/test.PNG';

function feed() {
    for (var i = 0; i < siteData.homePage.clubInfo.clubmembers.length; i++) {
        return(
            memberCard(i,pres)
            );
    }
}

function members() {
//

return (
    <div class="row">
        {feed()}
    </div>
    );
}
export default members;
